import React from 'react';

export const members = [
  {
    name: 'Stiven',
    partner: 'Emily',
    dateOfBirth: '12/02/1950',
    children: [
      {
        name: 'Andrew',
        partner: 'Ann',
        dateOfBirth: '30/06/1968',
        children: [
          { name: 'Sam', dateOfBirth: '03/08/1981'},
          { name: 'Monika', dateOfBirth: '18/04/1983'}
        ]
      },
      {
        name: 'Ashley',
        partner: 'David',
        dateOfBirth: '03/03/1974',
        children: [
          { name: 'John', dateOfBirth: '08/05/1991'},
          { name: 'Jack', dateOfBirth: '13/05/1994'}
        ]
      }
    ]
  }
];

class Tree extends React.Component {
  state = { open: false };

  onToggle = (event) => {
    this.setState({ open: !this.state.open });
  }

  render() {

    return (
      <div>
        {members.map(member => (
          <button onClick={(event) => this.onToggle(event)}>
            {member}
          </button>
        ))}
      </div>
    )
  }
}

export default Tree;
